import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-primary">
      <a className="navbar-brand" href="/">
        pose
      </a>
      <a className="navbar-brand float-right" href="/main">
        main
      </a>
    </nav>
  );
}

export default Nav;
